import Main_navbar from "./components/Main_navbar";
import Footer from "./components/Footer";
import Background from "./components/Background";
import Fundo from './assets/fundo.jpeg'
import './Global.css'

function App() {
  return (
    <>
      <Main_navbar/>
      <Background background-image={Fundo} />
      <Footer />
    </>
  );
}

export default App;
